import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import WorkoutTracker from './components/WorkoutTracker';
import FoodTracker from './components/FoodTracker';
import CalorieTracker from './components/CalorieTracker';
import StreakTracker from './components/StreakTracker';
import WalkTracker from './components/WalkTracker';
import './styles/main.css';

const App = () => {
  return (
    <Router>
      <div className="app">
        <Switch>
          <Route path="/" exact component={Dashboard} />
          <Route path="/workout" component={WorkoutTracker} />
          <Route path="/food" component={FoodTracker} />
          <Route path="/calories" component={CalorieTracker} />
          <Route path="/streak" component={StreakTracker} />
          <Route path="/walk" component={WalkTracker} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
